The Football League Show 02.02.2014

Duration: 1 hour 20 min

Manish Bhasin presents all the drama from the Football League, as the focus shifts to the battle against the drop at the bottom of the Championship, with Sheffield Wednesday meeting Barnsley in a Yorkshire derby. Meanwhile, at the other end of the table, pre-season title favourites QPR entertain one of the season's surprise packages, Burnley.
